import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { useMediaQuery } from 'react-responsive';
import photo1 from '../assets/img/Mentor.jpeg';
import photo2 from '../assets/img/BookNow.png';
import photo3 from '../assets/img/becomeMentor.jpeg';
import photo4 from '../assets/img/bg-masthead.jpg';
import { Link } from 'react-router-dom';
import { useNavigate } from 'react-router-dom';
import { STAMMERING_STATUS_MAP } from '../constants/map';


export const Mentor = () => {

    // let navigate = useNavigate();

    // const handleBooking = (e) => {
    //     navigate("/mentor/" + props.mentorObj.name, {
    //         replace: false, state: { mentorObj: props.mentorObj }
    //     });
    // }

    return (
        <div className='container-fluid'>
            <div className="container-fluid text-center t1">
                <h3 className="fw-bolder">Meet Our Mentor</h3>
                <div className="text-ceneter fw-normal mt-3">
                    <p>Realize your fullest potential and lay a concrete path to recovery with industry-best doctors and <br /> experienced mentors who are here to give you affordable, but and step-by-step support<br />to embolden you with your highest self!</p>
                </div>
                <button type="button " className="fw-bolder btn btn-primary btn-lg">I want to become a mentor!</button>
            </div>
            <section className="features-icons text-center ">
                <div className="container ch">
                    <div className="row" >
                        <div className="col-md-4 mb-3 cq">
                            <div className="card">
                                <img src={photo1} className="card-img-top" alt="..." />
                                <div className="card-body">
                                    <h5 className="card-title">1:1 Mentorship</h5>
                                    <p className="card-text mt-4">Book 1:1 Mentorship sessions with friends who have overcome stammering themselves</p>
                                </div>
                            </div>
                        </div>
                        <div className="col-lg-4 mb-3 cq">
                            <div className="card">
                                <img src={photo2} className="card-img-top" alt="..." />
                                <div className="card-body">
                                    <h5 className="card-title">Join Events</h5>
                                    <p className="card-text mt-4">Interact with fellow stammerers with various events</p>
                                </div>
                            </div>
                        </div>
                        <div className="col-lg-4 mb-3 cq">
                            <div className="card">
                                <img src={photo3} className="card-img-top" alt="..." />
                                <div className="card-body">
                                    <h5 className="card-title">Parents of Stammerers</h5>
                                    <p className="card-text mt-4">Parents of stammerers can connect among themselves</p>
                                </div>
                            </div>
                        </div>
                        {/* <div className="col-lg-3">
                            <div className="features-icons-item mx-auto mb-5 mb-lg-3">
                                <div className="features-icons-icon d-flex"><i className="fa fa-book m-auto text-primary"></i></div>
                                <h3>Speech Therapists</h3>
                                <p className="lead mb-0">Connect with multiple Speech Therapists</p>
                            </div>
                        </div> */}
                    </div>
                </div>
            </section>
            <div class="text text-center">
                <h3 class="fw-bolder mt-5">Some kind feedback from our dear stammerers</h3>
            </div>
        </div>

    )
}
